import React from "react";
import { connect } from "react-redux";
import { diet } from "../actions/session";


const mapStateToProps = ({ errors }) => ({
  errors
});
const mapDispatchToProps = dispatch => ({
    diet: user => dispatch(diet(user))
});
const Login = ({ errors, diet }) => {
  const handleSubmit = e => {
    e.preventDefault();
    const user = {
        dietry: e.target[0].value
    };
    const dietry = {
        dietry: e.target[0].value
      };
    diet(user, dietry);
  }
  return (
    <>
    <br/>
    <br/>
    <br/>
    <br/>
    <br/>

      <p>{errors}</p>
      <form onSubmit={handleSubmit}>
        <label>
          Email:
          <input type="username" name="dietry" placeholder="{user.diet}" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </>
  );
};
export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Login);
